import React from 'react'
import { Button } from '../Button/Button'
import './Footer.scss'
export const Footer = () => {
  return (
    <div className='footer'>
      <div className="footer-headline-container">
        <h1>We've prepared everything, it's time for you to tell the problem</h1>
        <Button></Button>
      </div>
    </div>
  )
}
